export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:10}}},f89mi0HKsz:{data:{id:671,attributes:{imdbId:"tt0082199",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNTY5ZDg5ZGEtM2FmZS00MjMyLWJhMDAtNjBmMmZlOWU2ZWU0XkEyXkFqcGdeQXVyMTEwODg2MDY@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Rotten Tomatoes",Value:"27%"},{Source:"Metacritic",Value:"46\u002F100"}],item_lang:{data:{id:1334,attributes:{title:"Condorman",plot:"Comic artist and writer Woody performs a simple courier operation for his friend Harry who works for the CIA. But when he successfully fends off hostile agents, he earns the respect of the beautiful Natalia, who requests his assistance for her defection. Woody uses this request as leverage to use the CIA's resources to bring his comic book creation, Condorman, to life to battle the evil Krokov.",slug:"condorman"}}},books:{data:[{id:4506,attributes:{title:g,description:i,thumbnail:j,authors:[b],firstBook:true,published:k,publisher:d,subtitle:l}},{id:4507,attributes:{title:g,description:i,thumbnail:j,authors:[b],firstBook:e,published:k,publisher:d,subtitle:l}},{id:4508,attributes:{title:"Citizen in Space",description:"Marvin Goodman thinks he has discovered an unknown paradise and buys “A Ticket to Tranai.” What starts as Utopia ends up becoming a death trap. The eleven other stories included in this collection are “The Mountain Without a Name,” “The Accountant,” “Hunting Problem,” “A Thief in Time,” “The Luckiest Man in the World,” “Hands Off,” “Something for Nothing,” “The Battle,” “Skulking Permit,” “Citizen in Space,” and “Ask a Foolish Question.” From the very beginning of his career, Robert Sheckley was recognized by fans, reviewers, and fellow authors as a master storyteller and the wittiest satirist working in the science fiction field. Open Road is proud to republish his acclaimed body of work, with nearly thirty volumes of full-length fiction and short story collections. Rediscover, or discover for the first time, a master of science fiction who, according to the New York Times, was “a precursor to Douglas Adams.”",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4BuFAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:m,publisher:d,subtitle:n}},{id:4509,attributes:{title:"Pilgrimage to Earth",description:"Science fiction tales from “one of the genre's leading humorists” (The New York Times Book Review). In “Pilgrimage to Earth,” on a long-desired trip to the home planet, a young man finds a perfectly developed society and, finally, deep, true love—which, sadly, only lasts for a very limited time before the reset button removes all trace of it. The fourteen other stories in this collection are “All the Things You Are,” “Trap,” “The Body,” “Early Model,” “Disposal Service,” “Human Man’s Burden,” “Fear in the Night,” “Bad Medicine,” “Protection,” “Earth, Air, Fire, and Water,” “Deadhead,” “The Academy,” “Milk Run,” and “The Lifeboat Mutiny.” From the very beginning of his career, Robert Sheckley was recognized by fans, reviewers, and fellow authors as a master storyteller and the wittiest satirist working in the science fiction field. Open Road is proud to republish his acclaimed body of work, with nearly thirty volumes of full-length fiction and short story collections. Rediscover, or discover for the first time, a master of science fiction who, according to the New York Times, was “a precursor to Douglas Adams.”",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KhyFAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:m,publisher:d,subtitle:n}},{id:4510,attributes:{title:g,description:f,thumbnail:f,authors:[b],firstBook:e,published:"1968-01-01",publisher:f,subtitle:f}}]}}},meta:{}}},prerenderedAt:1694069486785}}("movie","Robert Sheckley","series","Open Road Media",null,"","The Game of X",1,"All secret agents need to look out for William Nye, now known as Agent X. His recruitment was simple and his legend is brilliant but unearned. Somehow, he thinks he’s the best there is, and we all know how pride goeth before a fall. The master of SF hilarity and biting social satire creates a spy world that has gathered praise from the greats of the genre. From the very beginning of his career, Robert Sheckley was recognized by fans, reviewers, and fellow authors as a master storyteller and the wittiest satirist working in the science fiction field. Open Road is proud to republish his acclaimed body of work, with nearly thirty volumes of full-length fiction and short story collections. Rediscover, or discover for the first time, a master of science fiction who, according to the New York Times, was “a precursor to Douglas Adams.”","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=l7oqAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2014-04-01","A Novel of Upmanship Espionage","2014-05-13","Stories"))